    public class CargoConfig : IEntityTypeConfiguration<Cargo>
    {
        public void Configure(EntityTypeBuilder<Cargo>builder){

            //Tabela
            builder.ToTable("Cargo");
            
            //Primary Key
            builder.HasKey(p => p.Id);
            
            //Atributos
            builder.Property(f => f.Id)
            .HasColumnName("Id")
            .ValueGeneratedOnAdd()
            .IsRequired();

            builder.Property(f => f.CodigoLocalTrabalho)
            .HasColumnName("CodigoLocalTrabalho")
            .HasMaxLength(5)
            .IsRequired();

            builder.Property(f => f.CentroCusto)
            .HasColumnName("CentroCusto")
            .HasMaxLength(14)
            .IsRequired(false);

            builder.Property(f => f.NomeLocalTrabalho)
            .HasColumnName("NomeLocalTrabalho")
            .HasMaxLength(100)
            .IsRequired();
        }

